import React, { useState, useEffect } from "react";

export function getApiCalls(url, type, map) {
  return fetch(url, {
    method: type,
    headers: {
      "content-Type": "application/json",
    },
  })
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      return data; // Return the data to be used elsewhere
    });
}

export function postApiCalls(url, type, map) {
  return fetch(url, {
    method: type,
    headers: {
      "content-Type": "application/json",
    },
  })
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      return data; // Return the data to be used elsewhere
    });
}
